import React from 'react';

import './index.css';

export default function Game({ history }) {
  return (
    <>
      <h1 className="title" >SASKE</h1>
      <div className="game-window">
        <p>WHAT TO DO</p>
        <p>PALAVRA</p>
        <button className="game-btn" id="left">BOTAO DA ESQUERDA</button>
        <button className="game-btn" id="right">BOTAO DA DIREITA</button>
      </div>
      <button className="back" onClick={() => history.push('/')}>VOLTAR</button>
    </>
  );
}
